import React from "react";
import './forecastDays.css';

export default class ForecastDays extends React.Component{
    render(){
        const items = this.props.forecastForDays.map(
            item=>{
                <div><h1>item</h1></div>
            }
        );

        return(
            <>
                <div id="days">
                    {items}
                </div>
            </>
        )
    }

}
